/**
 * Get asset module for a given file path
 * @param filePath - Relative path from uw-translation-resources (e.g., "git.door43.org/unfoldingWord/en/ult/gen.json.gz")
 */
export function getAssetModule(filePath: string): any | null {
  return assetManifest[filePath] || null;
}

/**
 * Check if an asset exists in the manifest
 */
export function hasAsset(filePath: string): boolean {
  return filePath in assetManifest;
}

/**
 * Get all available asset paths
 */
export function getAllAssetPaths(): string[] {
  return Object.keys(assetManifest);
}

